import React from 'react';
import { Stage, Layer, Rect, Text } from 'react-konva';
import Konva from 'konva';
import './App.css';
import ColoredRect from './components/ColoredRect';

function App() {
  return (
    <div className="App">

<Text text="Try click on rect" />
      <Stage width={500} height={500}>
          <Layer>

            <ColoredRect xpos={10}/>
          </Layer>
        </Stage>
    </div>
  );
}

export default App;
